import styled from 'styled-components';
import { ServicesItem } from './ServicesItem';
import { RiPencilRulerLine } from 'react-icons/ri';
import { GoLightBulb } from 'react-icons/go';
// import pencil from '../../img/pencil.svg'


const ServicesSection = styled.div`
display: flex;
padding: 100px 0;
background-color: #fafafa;
`;
const ServicesContainer = styled.div`
margin: 0 auto;
width: 88%;
`;


const ServicesContent = styled.div`
display: grid;
grid-template-columns: repeat(3, 1fr);
gap: 30px;
`;
const ServicesTitle = styled.h2`
text-align: center;
`;


const Services = (props) => {

    return (
        <ServicesSection>
            <ServicesContainer>
                <ServicesTitle>Bester <span>Service</span></ServicesTitle>
                <ServicesContent>
                    <ServicesItem icon={<RiPencilRulerLine/>}  title='UI / UX-Design' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                    <ServicesItem icon={RiPencilRulerLine}  title='Markenidentität' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                    <ServicesItem icon={<GoLightBulb/>}  title='Kreative Idee' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                    <ServicesItem icon={RiPencilRulerLine}  title='Einfach zu verwenden' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                    <ServicesItem icon={RiPencilRulerLine}  title='Dynamisches Wachstum' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                    <ServicesItem icon={RiPencilRulerLine}  title='Freundliche Unterstützung' description='Lorem ipsum dolor sitzen amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet.' />
                </ServicesContent>
            </ServicesContainer>
        </ServicesSection>
    )
}

export default Services
